import jsPDF from 'jspdf';
import { autoTable } from 'jspdf-autotable';

export const generateOrderPdf = (pedidoData) => {
    try {
        const doc = new jsPDF({ unit: 'pt', format: 'a4' });

        const logoBase64 = 'data:image/jpeg;base64,';
        doc.addImage(logoBase64, 'PNG', 40, 30, 100, 100);

        // -- INFORMAÇÕES DA EMPRESA -- 
        doc.setFontSize(8);

        const pageWidth = doc.internal.pageSize.getWidth();
        const margin = 40;
        const x = pageWidth - margin;
        let y = 50;
        const lineHeight = 10;

        doc.setFont('helvetica', 'bold');
        doc.text('CONCEITO FESTAS LTDA', x, y, { align: 'right' });
        y += lineHeight;

        doc.setFont('helvetica', 'normal');
        doc.text('44.190.482/0001-65', x, y, { align: 'right' });
        y += lineHeight;
        doc.text('Rua Barão do Rio Branco, 4876', x, y, { align: 'right' });
        y += lineHeight;
        doc.text('Vila Industrial, Toledo - PR', x, y, { align: 'right' });
        y += lineHeight;
        doc.text('85.905-040', x, y, { align: 'right' });
        y += lineHeight;
        doc.text('9091686438', x, y, { align: 'right' });

        // -- HEADER -- 
        doc.setFontSize(11).setFont('helvetica', 'bold');
        doc.text(`Pedido de Venda Nº ${pedidoData.numero}`, doc.internal.pageSize.getWidth() / 2, 160, { align: 'center' });

        // -- DADOS DO CLIENTE --
        const clienteY = 200;

        doc.setFontSize(9).setFont('helvetica', 'bold');
        doc.text('Dados do Cliente', 40, clienteY - 5);

        doc.rect(40, clienteY, doc.internal.pageSize.getWidth() - 300, 38);

        doc.setFontSize(9).setFont('helvetica', 'normal');

        let yAtual = clienteY + 15;

        doc.text(`${pedidoData.contato.nome}`, 45, yAtual);
        yAtual += 15;

        if (pedidoData.contato.numeroDocumento) {
            doc.text(`${pedidoData.contato.numeroDocumento}`, 45, yAtual);
            yAtual += 15;
        }

        // -- VENDEDOR --
        const vendedorY = 270;

        doc.setFontSize(9).setFont('helvetica', 'bold');
        doc.text('Vendedor', 40, vendedorY - 5);

        doc.rect(40, vendedorY, doc.internal.pageSize.getWidth() - 300, 25);

        doc.setFontSize(9).setFont('helvetica', 'normal');

        const nomeVendedor = pedidoData.vendedor_nome || 'Não informado';
        doc.text(nomeVendedor, 45, vendedorY + 15);

        // -- TABELA DE ITENS --
        const tableColumn = ["Item", "Código", "Qtd", "Preço un", "Total"];
        const tableRows = [];
        const itens = pedidoData.itens || [];

        tableRows.push(tableColumn);

        itens.forEach(item => {
            const itemData = [
                item.descricao,
                item.codigo,
                Number(item.quantidade).toFixed(2),
                Number(item.valor).toLocaleString('pt-BR', { style: 'currency', currency: 'BRL' }),
                (item.quantidade * item.valor).toLocaleString('pt-BR', { style: 'currency', currency: 'BRL' })
            ];
            tableRows.push(itemData);
        });

        const tabelaY = 325;

        autoTable(doc, {
            body: tableRows,
            startY: tabelaY,
            theme: 'grid',
            didParseCell: function (data) {
                if (data.row.index === 0) {
                    data.cell.styles.fontStyle = 'bold';
                    data.cell.styles.fillColor = [240, 240, 240];
                }
            },
            styles: {
                font: 'helvetica',
                fontSize: 9,
                cellPadding: 6,
                textColor: [0, 0, 0],
                lineColor: [0, 0, 0]
            },
            margin: { left: 40, right: 40 },
        });

        // -- TOTAIS --
        let finalY = doc.lastAutoTable.finalY;
        
        const numeroDeItens = itens.length;
        const somaDasQuantidades = itens.reduce((total, item) => total + Number(item.quantidade), 0);
        const totalProdutos = itens.reduce((total, item) => total + (item.quantidade * item.valor), 0);

        const totalProdutosFormatted = totalProdutos.toLocaleString('pt-BR', {style: 'currency', currency: 'BRL' });
        const totalPedidoFormatted = Number(pedidoData.total).toLocaleString('pt-BR', { style: 'currency', currency: 'BRL' });

        autoTable(doc, {
            startY: finalY + 10,
            theme: 'grid',

            body: [
                [
                    { content: `Número de itens: ${numeroDeItens}`, colSpan: 2, styles: { halign: 'left' } },
                    { content: 'Total de produtos', styles: { halign: 'right' } },
                    { content: totalProdutosFormatted, styles: { halign: 'right', fontStyle: 'bold' } }
                ],
                [
                    { content: `Soma das quantidades: ${somaDasQuantidades.toFixed(2)}`, colSpan: 2, styles: { halign: 'left' } },
                    { content: 'Total do pedido', styles: { halign: 'right' } },
                    { content: totalPedidoFormatted, styles: { halign: 'right', fontStyle: 'bold' } }
                ]
            ],

            styles: {
                font: 'helvetica',
                fontSize: 9,
                cellPadding: 6,
                textColor: [0, 0, 0],
                lineColor: [0, 0, 0]
            },
            margin: { left: 40, right: 40 },
            columnStyles: {
                0: { cellWidth: 300 },
                1: { cellWidth: 'auto' },
                2: { cellWidth: 'auto' },
                3: { cellWidth: 80, },
            }
        });

        // -- CONDIÇÕES DE PAGAMENTO (PARCELAS) --
        let startY = doc.lastAutoTable.finalY + 30;

        if (doc.internal.pageSize.getHeight() - startY < 100) {
            doc.addPage();
            startY = margin;
        } 

        const condicoesPagamentoMap = {
            '3359853': { dias: [7], forma: '1x - Boleto 7 dias' },
            '2076718': { dias: [30], forma: '1x - Boleto bancário para 30 dias' },
            '2076727': { dias: [60], forma: '1x - Boleto bancário para 60 dias' },
            '2076783': { dias: [30], forma: '1x - Cheque 30 dias' },
            '7758544': { dias: [1], forma: '1x - Boleto á vista' },
            '4421026': { dias: [7, 14], forma: '2x - Boleto bancário 7, 14 dias' },
            '2076737': { dias: [28, 35], forma: '2x - Boleto bancário para 28, 35 dias' },
            '2091116': { dias: [30, 45], forma: '2x - Boleto bancário para 30, 45 dias' },
            '3514108': { dias: [30, 45, 60], forma: '3x - Boleto bancário 30, 45, 60 dias' },
            '2076738': { dias: [28, 35, 42], forma: '3x - Boleto bancário para 28, 35, 42 dias'},
            '2076750': { dias: [30, 45, 60], forma: '3x - Boleto bancário para 30, 45, 60 dias'},
            '2306222': { dias: [28, 35, 42, 49], forma: '4x - Boleto bancário para 28, 35, 42, 49 dias' },
            '2076765': { dias: [28, 35, 42, 49, 56], forma: '5x - Boleto bancário para 28, 35, 42, 49, 56 dias'},
            '2127537': { dias: [1], forma: 'Á Vista - Pix' },
        };

        const parcelasHeadRow = ['Dias', 'Data vencimento', 'Forma de pagamento', 'Valor', 'Observação'];
        const parcelasBody = [];

        parcelasBody.push(parcelasHeadRow);

        const parcelas = pedidoData.parcelas || [];
        parcelas.forEach((parcela, index) => {
            const condicao = condicoesPagamentoMap[parcela.formaPagamento.id];
            const dias = (condicao && condicao.dias && condicao.dias[index] !== undefined)
                ? condicao.dias[index]
                : 'N/A';

            const formaPagamento = condicao ? condicao.forma : 'Não informado';

            const dataVencimentoObj = new Date(parcela.dataVencimento);

            parcelasBody.push([
                dias, // Usa o dia correspondente à parcela (dias[0], dias[1], etc.)
                dataVencimentoObj.toLocaleDateString('pt-BR', {timeZone: 'UTC'}),
                formaPagamento,
                Number(parcela.valor).toLocaleString('pt-BR', { style: 'currency', currency: 'BRL' }),
                parcela.observacoes || ''
            ]);
        });

        autoTable(doc, {
            startY: startY,
            body: parcelasBody,
            theme: 'grid',
            didParseCell: function (data) {
                if (data.row.index === 0) {
                    data.cell.styles.fontStyle = 'bold';
                    data.cell.styles.fillColor = [245, 245, 245];
                }
            },
            styles: {
                font: 'helvetica',
                fontSize: 9,
                cellPadding: 6,
                textColor: [0, 0, 0],
                lineColor: [0, 0, 0]
            },
            margin: { left: 40, right: 40 },
        });

        // -- Inicia o download --
        doc.save(`Pedido-${pedidoData.numero}.pdf`);

    } catch (error) {
        console.error("Erro ao gerar PDF:", error);
        alert("Houve um erro ao gerar o PDF. Verifique o console para mais detalhes.");
    }
};